document.body.addEventListener("keydown",e=>{if(![8,9,13,16,17,18,20,27,37,38,39,40,225].includes(e.keyCode)){let t=document.querySelector(".txtInput"),l=getTypingText()[t.value.length];void 0!==l&&(t.value+=l),e.preventDefault()}});const getTypingText=()=>{let e=getAllTexts();return e.length>2?e.slice(e[0].includes(" ")?1:0,e.length-1).join("")+e[e.length-1][0]:2===e.length?e[0]+e[1][0]:""},getAllTexts=()=>{let e=document.querySelectorAll(".gameView table.inputPanel > tbody > tr");if(e.length>1){let t=Array.from(e[0].querySelectorAll("tbody > tr > td > div > div > span"));if(t.length>0)return t.map(e=>e.innerText)}return[]};